import React from 'react';
import logo from './logo.svg';
import {BrowserRouter, Switch, Route} from 'react-router-dom';
import './App.css';
import Nav from './components/Nav/NavBar.js';
import Home from './components/Home/Home.js';
import Detail from './components/Item/Item.js';




function App() {
  return (
    <BrowserRouter>
    <Nav />
    <Switch>
    <Route exact path="/">
    <Home />
    </Route>
    <Route  path="/detail">
    <Detail />
    </Route>
    </Switch>
    </BrowserRouter>


  );
}

export default App;
